          "id": "ac8fc9e4d126ead2994434a4a3283d5bc0c38ca7",
          "message": "perf: heuristic selectivity for expensive search queries (#4172)\n\n# Ticket(s) Closed\n\n- Closes #2724\n\n## What\n\nShort-circuit selectivity estimation for query types where constructing\na Tantivy `Scorer` is expensive (fuzzy term, regex). Instead of opening\nthe index and building a full scorer, return a cheap heuristic\nselectivity based on query type and parameters.\n\n## Why\n\n`estimate_selectivity` is called during Postgres planning. For fuzzy and\nregex queries it needs to build DFAs/automata and scan the term\ndictionary just to produce a row-count estimate. On large indexes this\nmakes planning itself slow, which defeats the purpose of having an\nindex.\n\n## How\n\n- Added `is_expensive_to_estimate()` and `selectivity_heuristic()` on\nboth `SearchQueryInput` and `pdb::Query`. These recursively walk\nboolean/wrapper queries to detect expensive leaves (fuzzy term, regex,\nregex phrase, parse-with-field w/ fuzzy, more-like-this) and return a\ntype-appropriate constant (e.g. 0.01 for fuzzy distance  1, 0.05 for\ndistance  2, 0.01 for regex).\n- `estimate_selectivity` checks the new GUC\n`paradedb.enable_heuristic_selectivity` (default `true`) and, when the\nquery is expensive, returns the heuristic immediatelyno index I/O.\n- Range queries and match-with-distance are intentionally **not**\nclassified as expensive: range queries on numeric fast fields are cheap\nto score, and their selectivity is too data-dependent for a fixed\nheuristic. Including them caused plan regressions (wrong join\nstrategies, wrong append methods) in existing tests.\n\n## Tests\n\n- `expensive_estimate.sql`  verifies plans and result correctness for\nfuzzy term (distance 1 & 2), regex, etc.\n\n<details>\n<summary>Benchmark (not included in PR  run manually)\n\n10k-row table, 200 EXPLAIN plans (100  fuzzy + 100  regex):\n\n| Mode | Time |\n|------|------|\n| Heuristic ON  | ~81 ms |\n| Heuristic OFF | ~417 ms |\n\n**~5 planning speedup** for fuzzy/regex queries.\n</summary>\n\n\n\n```sql\n-- bench_heuristic_selectivity.sql\n-- Benchmark: heuristic selectivity vs full scorer estimation.\n-- Compares planning time for expensive queries (fuzzy, regex)\n-- with and without the heuristic short-circuit.\n\n\\i common/common_setup.sql\n\nCREATE TABLE bench_items (\n    id SERIAL PRIMARY KEY,\n    description TEXT NOT NULL,\n    rating INT NOT NULL,\n    created_at TIMESTAMP NOT NULL\n);\n\nINSERT INTO bench_items (description, rating, created_at)\nSELECT\n    CASE (i % 10)\n        WHEN 0 THEN 'comfortable running shoes for athletes'\n        WHEN 1 THEN 'premium leather hiking boots on sale'\n        WHEN 2 THEN 'lightweight canvas sneakers for summer'\n        WHEN 3 THEN 'waterproof winter boots with insulation'\n        WHEN 4 THEN 'elegant dress shoes for formal occasions'\n        WHEN 5 THEN 'durable steel toe work boots'\n        WHEN 6 THEN 'classic oxford shoes in black'\n        WHEN 7 THEN 'breathable mesh running shoes'\n        WHEN 8 THEN 'handcrafted Italian loafers'\n        WHEN 9 THEN 'vintage retro sneakers collection'\n    END,\n    (i % 5) + 1,\n    '2023-01-01'::timestamp + (i || ' minutes')::interval\nFROM generate_series(1, 10000) AS s(i);\n\nCREATE INDEX idx_bench ON bench_items\n    USING bm25 (id, description, rating, created_at)\n    WITH (key_field='id');\n\nANALYZE bench_items;\n\n-- Heuristic ON (default)\nSET paradedb.enable_heuristic_selectivity = ON;\n\nDO $$\nDECLARE\n    t_start timestamptz; t_end timestamptz;\n    elapsed_ms double precision; dummy text;\nBEGIN\n    t_start := clock_timestamp();\n    FOR i IN 1..100 LOOP\n        EXECUTE 'EXPLAIN SELECT * FROM bench_items WHERE description @@@ paradedb.fuzzy_term(field => ''description'', value => ''sheos'', distance => 2::integer)' INTO dummy;\n        EXECUTE 'EXPLAIN SELECT * FROM bench_items WHERE description @@@ paradedb.regex(field => ''description'', pattern => ''sh.*es'')' INTO dummy;\n    END LOOP;\n    t_end := clock_timestamp();\n    elapsed_ms := extract(epoch FROM t_end - t_start) * 1000;\n    RAISE WARNING 'heuristic ON:  200 EXPLAIN plans in % ms', round(elapsed_ms::numeric, 1);\nEND;\n$$;\n\n-- Heuristic OFF\nSET paradedb.enable_heuristic_selectivity = OFF;\n\nDO $$\nDECLARE\n    t_start timestamptz; t_end timestamptz;\n    elapsed_ms double precision; dummy text;\nBEGIN\n    t_start := clock_timestamp();\n    FOR i IN 1..100 LOOP\n        EXECUTE 'EXPLAIN SELECT * FROM bench_items WHERE description @@@ paradedb.fuzzy_term(field => ''description'', value => ''sheos'', distance => 2::integer)' INTO dummy;\n        EXECUTE 'EXPLAIN SELECT * FROM bench_items WHERE description @@@ paradedb.regex(field => ''description'', pattern => ''sh.*es'')' INTO dummy;\n    END LOOP;\n    t_end := clock_timestamp();\n    elapsed_ms := extract(epoch FROM t_end - t_start) * 1000;\n    RAISE WARNING 'heuristic OFF: 200 EXPLAIN plans in % ms', round(elapsed_ms::numeric, 1);\nEND;\n$$;\n\nRESET paradedb.enable_heuristic_selectivity;\nDROP TABLE bench_items CASCADE;\n```\n\n</details>",
